import React from '.react';

function App() {
  // [count, setCount] = useState();

  let likes = 0;
  return (
    <div className='App'>

      <button onClick={() => likes += 1}>Increment</button>
      <button onClick={() => likes -= 1}>Decrement</button>
    </div>
  );
}

export default App;
